import React from 'react'

function Camera() {
  return (
    <div>
      <div>
        <img src="https://m.media-amazon.com/images/I/914hFeTU2-L._SL1500_.jpg"></img>
        <span>Canon EOS 1500 D</span>
      </div>
    </div>
  );
}

export default Camera
